import React from 'react';
import './education.css';

function Education() {
    return (
        <div className="education-container">
            <div className="XDUlogo">
                <img src="/XDUlogo.png" alt="XDUlogo" />
            </div>

            <div className="education-details">
                <h2>Bachelor of Information Technology</h2>
                <p>XiDian University</p>
                <p>Graduated in 2024</p>
                <p>Major: Software Engineer</p>
                <ul>
                    <li>GPA: 3.8/4.0</li>
                    <li>Minor in Networks & Security</li>
                    <li>Minor in Mobile Applications</li>
                    <li>Dean's List - 2021 & 2022</li>
                </ul>
            </div>
        </div>
    );
}

export default Education;
